import React from "react";

import "./App.css";
import Header from "./Header";

const App = () => {
  return (
      <div className="App">
          <header>
              <img src="https://png.pngtree.com/png-clipart/20190515/original/pngtree-gladiator-logo-png-image_3629358.jpg" alt="" />
          </header>
          <nav>
            <div>Profile</div>
          </nav>
          <div>Main content</div>
      </div>
  );
};

export default App;
